ad. Affected URL:'=>'Az ICS-fájl nem olvasható be, vagy üres. Kérjük, ellenőrizze URL helyes, és ellenőrizze a php.ini konfiguráció ellenőrzésére vagy cURL vagy allow_url_fopen áll rendelkezésre. Ha szóközöket használ több URL-karakter elhatárolódására, akkor érdemes lehet inkább a csőkaraktert használni. Érintett URL:Affected URL:','Hide past events'=>'Múltbeli események elrejtése','Show past events'=>'Elmúlt események megjelenítése','Contact:'=>'Kapcsolat:','Resources:'=>'Források:','Click for more...'=>'Kattintson a további ...','Save to your calendar'=>'Mentés a naptárba','Cancelled'=>'Törölve','The legacy parser option is deprecated and will be removed in a future update.'=>'A régi elemző opció elavult, és egy jövőbeli frissítéssel eltávolításra kerül.','The "currentweek" shortcode attribute is deprecated. Please use view="week" in your shortcode instead.'=>'A "currentweek" shortcode attribútum elavult. Kérjük, használja a view="week" elemet a rövid kódjában.','The "legendinline" shortcode attribute is deprecated. Please use legendstyle="inline" in your shortcode instead.'=>'A "legendinline" rövidkód attribútum elavult. Kérjük, használja helyette a legendstyle="inline" attribútumot a rövidkódban.','Cleared %1$s %2$s transient(s).'=>'Törölt %1$s %2$s tranziens(ek).','No %1$s transients were found.'=>'Nem találtunk %1$s tranzienseket.','Your feed URL appears to contain HTTP Basic Authentication credentials. Try turning off the %1$s option under the %2$s tab above.'=>'Úgy tűnik, hogy a táp URL-címe HTTP Basic Authentication hitelesítő adatokat tartalmaz. Próbálja meg kikapcsolni a %1$s opciót a fenti %2$s fül alatt.','Use legacy feed request method'=>'Hagyományos takarmánykérési módszer használata','%1$sThis URL points to a file in your Media Library.%2$s While you should be able to use this URL in an %3$s shortcode, it will be a static snapshot of the calendar at the time the file was created, and will not reflect any future updates to the source calendar. Please see our %4$sUser Guide%5$s for instructions on obtaining your correct dynamic feed URL.'=>'%1$sEz az URL egy fájlra mutat a Médiatárban.%2$s Bár ezt az URL-t egy %3$s rövidkódban használhatod, ez egy statikus pillanatfelvétel lesz a naptárról a fájl létrehozásának időpontjában, és nem tükrözi a forrásnaptár jövőbeli frissítéseit. A helyes dinamikus feed URL-cím megszerzésével kapcsolatos utasításokat lásd a %4$sFelhasználói útmutatóban%5$s.','Error: Could not resolve IP address for %1$s.'=>'Hiba: %1$s IP-címét nem sikerült feloldani.','Resolved IP address for %1$s:'=>'Megoldott IP-cím a %1$s számára:','The text entered in the "Default shortcode" field is not a valid shortcode, and was not saved.'=>'Az "Alapértelmezett rövidkód" mezőbe beírt szöveg nem érvényes rövidkód, és nem lett elmentve.','%1$sSettings updated.%2$s You may need to refresh the page to see some changes.'=>'%1$sBeállítások frissítve.%2$s Lehet, hogy frissítenie kell az oldalt, hogy lássa a változásokat.','calendar event'=>'naptári esemény','The legacy feed request method is deprecated, and will be removed in an update in the near future. Please test your feeds with the legacy feed request method turned off.'=>'A régi takarmánykérési módszer elavult, és a közeljövőben egy frissítéssel eltávolításra kerül. Kérjük, tesztelje feedjeit a régi feedkérési módszer kikapcsolt állapotában.','Map'=>'Bản đồ','Recurring event'=>'Ismétlődő esemény','Recurs every %1$s years'=>'Minden %1$s évben ismétlődik','Recurs yearly'=>'Évente ismétlődik','Recurs every %1$s months'=>'Minden %1$s hónapban ismétlődik','Recurs monthly'=>'Havonta ismétlődik','Recurs every %1$s weeks'=>'Minden %1$s héten ismétlődik','Recurs weekly'=>'Hetente ismétlődik','Recurs every %1$s days'=>'Minden %1$s nap ismétlődik','Recurs daily'=>'Naponta ismétlődik','The "url" property in your %1$s shortcode appears to contain HTML tags; most likely your URL has been turned into a clickable link. Your calendar may not display properly as a result. Please remove the clickable link in the shortcode.'=>'A %1$s rövidkód "url" tulajdonsága úgy tűnik, hogy HTML-címkéket tartalmaz; valószínűleg az URL-címet kattintható linkké alakították át. Ennek következtében előfordulhat, hogy a naptárad nem jelenik meg megfelelően. Kérjük, távolítsa el a kattintható linket a rövidkódból.','The r34ics_url_get_contents() function is no longer supported.'=>'Az r34ics_url_get_contents() függvény már nem támogatott.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sMegjegyzés:%2$s %3$s A 10.6-os verzió megváltoztatja számos rövidkód beállításának alapértelmezett beállításait. A konzisztencia fenntartása érdekében ezek az új alapértelmezett beállítások %4$snem%5$s vannak engedélyezve, ha korábbi verzióról frissítesz. Ha többet szeretne megtudni a változásokról, kérjük, olvassa el %6$sblogbejegyzésünket%7$s, vagy az új alapértelmezett beállításokra való áttéréshez kapcsolja be a %8$s opciót a %9$s beállítások%10$s oldalon.','Use new parameter defaults (v.10.6)'=>'Új paraméter alapértelmezések használata (v.10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sMegjegyzés:%2$s %3$s A 11.0 verzió egyszerűsíti az ICS táp URL-ek lekérdezésének módját. Ez a változtatás egy szabványos beépített WordPress funkciót használ, így teljesen kompatibilisnek kell lennie minden meglévő telepítéssel. Ha a 11-es vagy újabb verzióra való frissítés után új problémákkal találkozol, kérjük, látogass el a %4$sWordPress támogatási fórumokra%5$s segítségért.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sMegjegyzés:%2$s %3$s A 11.5.14.2 verzió új, biztonságosabb módszert vezet be a naptárparaméterek kezelésére AJAX betöltéskor. Kérjük, törölje az esetlegesen használt gyorsítótárazási bővítményeket, hogy a naptárak az új módszerrel is megfelelően betöltődjenek.','Add %1$s'=>'%1$s hozzáadása','Close'=>'Bezár','ICS Feed URL:'=>'ICS Feed URL:','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Győződjön meg róla, hogy %1$ssubscribe%2$s URL-t használ, nem pedig %3$sweb view%4$s URL-t.%5$s (Ha közvetlenül a böngészőbe írja be az URL-t, akkor egy %6$s fájlt kell letöltenie.)','Calendar Title:'=>'Naptár címe:','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'Hagyja üresen a naptár alapértelmezett címének használatához. A cím teljes elhagyásához írja be a %1$s-t.','Calendar Description:'=>'Naptár leírása:','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'Hagyja üresen a naptár alapértelmezett leírásának használatát. Írja %s, hogy teljesen kihagyja a leírást.','View:'=>'Nézet:','month'=>'hónap','list'=>'lista','week'=>'hét','Count:'=>'Számláló:','Format:'=>'Formátum:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'Hagyja üresen a %1$s-t, ha az összes közelgő eseményt be kívánja vonni. %2$s egy szabványos %3$sPHP dátumformátumú karakterlánc%4$s.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Eseményleírások megjelenítése %1$s(a beillesztett rövidkódban számra változtatható a szóhatár beállításához)%2$s','Show event locations %1$s(if available)%2$s'=>'Eseményhelyszínek megjelenítése %1$s(ha van)%2$s','Show event organizers %1$s(if available)%2$s'=>'Eseményszervezők megjelenítése %1$s(ha van)%2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sMegjegyzés:%2$s További %3$smegjelenítési lehetőségek%4$s a rövidkód beszúrása utáni kézi szerkesztéssel érhetők el.','Insert %1$s'=>'Insert %1$s','Do even more with %1$s!'=>'Még többet tehetsz a %1$s-val!','Calendar Builder'=>'Naptárkészítő','Configure all calendar settings with an easy visual interface... no need to manually type shortcodes.'=>'Konfiguráljon minden naptárbeállítást egy egyszerű vizuális felületen... nem kell kézzel beírni a rövidkódokat.','Additional Views and Enhanced Features'=>'További nézetek és továbbfejlesztett funkciók','New ways to display your calendar including Full, Up Next, Masonry, Month with Sidebar, Widget, and more. Additional capabilities are added to the core Month, Basic, List and Week views.'=>'Új módok a naptár megjelenítésére, beleértve a Teljes, Következőre, Kőműves, Hónap oldalsávval, Widget, és még sok más. Az alapvető Hónap, Alap, Lista és Hét nézetek további képességekkel bővülnek.','Customizer'=>'Testreszabható','Easily modify your calendar color palettes, fonts, and more, site-wide.'=>'Könnyedén módosíthatja a naptár színpalettáját, betűtípusait és egyebeket, az egész webhelyen.','ICS Events'=>'ICS események','%1$sNew!%2$s Turns %3$s into a full calendar system. Create and manage events directly in WordPress and even integrate them seamlessly with your existing feeds.'=>'%1$sÚj!%2$s A %3$s-t teljes naptárrendszerré alakítja. Hozzon létre és kezeljen eseményeket közvetlenül a WordPressben, és akár zökkenőmentesen integrálja őket a meglévő feedjeibe.','Visit %1$s to learn more.'=>'Látogasson el a %1$s oldalra, ha többet szeretne megtudni.','Go PRO!'=>'Menj PRO!','Getting Started'=>'Kezdjük el','System Report'=>'Rendszerjelentés','Save Changes'=>'Módosítások mentése','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Köszönjük, hogy telepítette %1$s. Mielőtt létrehozná az első naptár rövidkódot, kérjük, látogasson el az %2$sÁltalános beállítások%3$s oldalra, és ellenőrizze, hogy az oldal nyelvi, időzóna és dátum/idő formátum beállításai megfelelőek-e. További információkért tekintse meg a %4$sFelhasználói útmutató%5$s-t.','Quick Start Guide'=>'Gyorsbeállítás varázsló','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'Egy részletes %1$sFelhasználói útmutató%2$s elérhető a weboldalunkon. Az alábbiakban néhány gyors linket talál a dokumentáció legfontosabb forrásaihoz.','General:'=>'Általános:','General WordPress Settings'=>'Általános WordPress beállítások','%1$s Settings'=>'%1$s Beállítások','Working with Shortcodes:'=>'Shortcode-okkal való munka:','Shortcode Overview'=>'Shortcode áttekintés','Shortcode Builder'=>'Rövidkód építő','Shortcode Parameters Reference'=>'Shortcode paraméterek hivatkozása','Advanced Topics:'=>'Haladó témák:','FAQs and Tips'=>'GYIK és tippek','CSS Guide'=>'CSS útmutató','Developer Resources'=>'Fejlesztői erőforrások','GDPR'=>'GDPR','Appearance'=>'Megjelenés','Match calendar color palette to current Block Theme colors'=>'A naptár színpaletta illesztése az aktuális Block Theme színekhez','beta'=>'béta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'A %1$s alapértelmezett semleges színpalettát az aktuális Site Editor Styles színpalettából vagy a téma %2$s fájljából származó legközelebbi színekkel helyettesíti. A színválasztás algoritmikus, és előfordulhat, hogy egyes kombinációk nem felelnek meg az akadálymentességi kontrasztvizsgálatnak. Ennek a beállításnak nincs hatása, ha olyan "klasszikus" témát használ, amely nem tartalmaz %3$s fájlt.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar settings or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sEz jelenleg egy béta-funkció.%2$s Az optimális megjelenítés érdekében szükség lehet néhány módosításra a naptárbeállításokban vagy a CSS-ben, különösen, ha a tápokat színkódokkal látja el. A funkcionalitás változhat.','Dark mode'=>'Sötét üzemmód','Inverts color palette (light colors on a dark background). %1$sNote:%2$s Dark mode also automatically applies style changes similar to the %3$s and %4$s shortcode parameters, so you do not need to include them in your shortcode.'=>'Inverz színpaletta (világos színek sötét háttéren). %1$sMegjegyzés:%2$s A sötét üzemmód automatikusan alkalmazza a %3$s és %4$s rövidkód paraméterekhez hasonló stílusváltozásokat is, így nem szükséges ezeket a rövidkódba foglalnia.','Loading'=>'Betöltés','Always use AJAX to render calendars (recommended)'=>'A naptárak megjelenítéséhez mindig használjon AJAX-ot (ajánlott)','When checked, all calendars will render via AJAX (asynchronously after the page loads). This is especially useful in conjunction with other caching plugins, or if your calendars contain a large number of events. Normally, calendar data is sent directly in the HTML of the initial page load unless AJAX has been specified in the shortcode.'=>'Ha be van jelölve, akkor az összes naptár AJAX-on keresztül (aszinkron módon az oldal betöltése után) jelenik meg. Ez különösen hasznos más gyorsítótárazási bővítményekkel együtt, vagy ha a naptárak nagyszámú eseményt tartalmaznak. Normális esetben a naptáradatok közvetlenül az oldal kezdeti betöltésének HTML-ében kerülnek elküldésre, kivéve, ha a rövidkódban AJAX van megadva.','Increase memory limit when rendering calendars'=>'Növelje a memóriakorlátot a naptárak megjelenítésekor','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Ha a naptár betöltése "nincs elég memória" végzetes hibaüzenettel sikertelen, próbálja meg növelni a memóriakorlátot. Legalább 512 MB ajánlott. %1$s Megjegyzések: 1) Egyes tárhelyszolgáltatók nem engedélyezik, hogy az alkalmazások felülbírálják a kiszolgáló alapértelmezett beállítását. 2) Ezt az opciót nem lehet a szerver aktuális alapértelmezett memóriakorlátjánál alacsonyabbra állítani.','deprecated'=>'elavult','If your site has stopped retrieving feeds after the version 11 update, turn on this option to use the legacy request method. This feature is deprecated and will be removed in an update in the near future.'=>'Ha webhelye a 11-es verzió frissítése után már nem kérte le a tápokat, kapcsolja be ezt a lehetőséget a régi kérési módszer használatához. Ez a funkció elavult, és a közeljövőben egy frissítéssel eltávolításra kerül.','Default shortcode'=>'Alapértelmezett rövidkód','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Ha a webhelye nagyszámú, hasonlóan konfigurált naptár rövidkódot tartalmaz, akkor itt megadhat egy alapértelmezett "alap" rövidkódot, amelynek paraméterei az összes naptár esetében azonosak kell, hogy legyenek. Az egyes rövidkódok a webhelyen ezután csak azokat a paramétereket tartalmazhatják, amelyek az adott naptárra egyedileg vonatkoznak: %1$s Az egyedi rövidkódban szereplő paraméterek felülírják az itt beállítottakat.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Engedélyezze a hozzáférést ezekhez az olyan hosztnevekhez, amelyek fenntartott IP-címekre oldódnak fel','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Ha a naptárszerver ugyanazon a fizikai szerveren van elhelyezve, mint a webhely, ugyanannak a helyi hálózatnak a része, vagy egyébként %1$sfenntartott IP-címet%2$s használ, adja meg itt a hostnevét a hozzáférés engedélyezéséhez. Több naptárkiszolgáló esetén soronként egy hosztnevet adjon meg. További információért lásd %3$sa %4$s dokumentációt%5$s.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Adjon meg soronként egy állomásnevet. A hosztnevek az alap tartománynevet jelentik, nem pedig a teljes URL-t. %1$s Például %2$s-et írjon be, ne %3$s-t.','Caching'=>'Gyorsítótárazás','Transient (cache) expiration'=>'Átmeneti (gyorsítótár) lejárat','seconds'=>'másodperc','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour).'=>'Beállítja, hogy a naptáradatokat mennyi ideig kell a szerveren gyorsítótárazni (WordPress tranziensek) az újratöltés előtt. Az alapértelmezett érték 3600 (1 óra).','Miscellaneous'=>'Vegyes','Remove "Add ICS Calendar" button in Classic Editor'=>'"ICS naptár hozzáadása" gomb eltávolítása a klasszikus szerkesztőben','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Alapértelmezés szerint az ICS Naptár a klasszikus szerkesztő használatakor a WYSIWYG-szerkesztő fölötti eszköztárhoz hozzáad egy "ICS-naptár hozzáadása" gombot. A gomb eltávolításához jelölje be ezt a négyzetet. Nincs hatással a blokkszerkesztőt (Gutenberg) használó webhelyekre.','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s A 10.6-os verzió új alapértelmezett értékeket vezetett be számos rövidkód paraméterhez. Az új telepítések automatikusan az új alapértelmezett értékeket használják, de a frissített telepítések továbbra is a régi alapértelmezett értékeket használják, hacsak ez a négyzet nincs bejelölve. Ezekről a változásokról bővebben a %2$sblogunkon%3$s olvashat.','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Teljes felhasználói kézikönyvünk több tucat nyelvre történő teljes fordítással elérhető a weboldalunkon:','For assistance, please use our %1$ssupport request form%2$s.'=>'Segítségért kérjük, használja a %1$stámogatási kérelem űrlapot%2$s.','When contacting support, please include the %1$sSystem Report%2$s from this page.'=>'Ha kapcsolatba lép az ügyfélszolgálattal, kérjük, adja meg az ezen az oldalon található %1$sRendszerjelentés%2$s-t.','Spread the word!'=>'Terjesszétek az igét!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Ha hasznosnak találja a %1$s-t, akkor egy %2$sötcsillagos értékeléssel%3$s segíthet támogatni folyamatos növekedésünket és fejlődésünket. Köszönjük!','%1$s Data Cache'=>'%1$s Adat gyorsítótár','Clear Cached Calendar Data'=>'Gyorsítótárazott naptáradatok törlése','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'Ez azonnal törli az összes meglévő gyorsítótárazott naptáradatot (tranzienseket töröl), arra kényszerítve a WordPress-t, hogy a következő megtekintéskor töltse újra az összes naptárat. A caching ezután folytatódik, mint korábban.','ICS Feed URL Tester'=>'ICS-hírcsatorna URL-tesztelője','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Ha aggódik, hogy a plugin nem megfelelően kéri le a feedjét, itt tesztelheti az URL-t.','Enter feed URL...'=>'Adja meg a hírcsatorna URL-címét...','Test URL'=>'Teszt URL-címe','Results:'=>'Eredmények:','%1$s received.'=>'%1$s érkezett.','This appears to be a valid ICS feed URL.'=>'Úgy tűnik, hogy ez egy érvényes ICS feed URL.','This does not appear to be a valid ICS feed URL.'=>'Úgy tűnik, hogy ez nem egy érvényes ICS feed URL.','Could not retrieve data from the requested URL.'=>'Nem lehetett adatokat lekérni a kért URL-címről.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Ismeretlen hiba történt a kért URL lekérése közben.','Please copy the following text and include it in your message when emailing support.'=>'Kérjük, másolja a következő szöveget, és vegye fel az üzenetbe, amikor e-mailt küld a támogatásnak.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Kérjük, hogy a %1$s rövidkódot is pontosan úgy adja meg, ahogyan azt az érintett oldalon beírta.','For your site security please do NOT post the System Report in the support forums.'=>'A webhely biztonsága érdekében kérjük, NE tegye közzé a rendszerjelentést a támogatási fórumokon.','No events found.'=>'Nem található esemény.','Previous Page'=>'Előző oldal','Next Page'=>'Következő oldal','All Day'=>'Egész nap','Today'=>'Ma','No events.'=>'Nincsenek események.','No additional events this month.'=>'Ebben a hónapban nincs további esemény.','Last week'=>'Múlt héten','This week'=>'Ezen a héten','Next week'=>'Következő héten','ICS Calendar'=>'ICS Calendar','https://icscalendar.com'=>'https://icscalendar.com','Turn your Google Calendar, Microsoft Office 365 or Apple iCloud Calendar into a seamlessly integrated, auto-updating, zero-maintenance WordPress experience.'=>'A Google Naptár, a Microsoft Office 365 vagy az Apple iCloud Naptár zökkenőmentesen integrált, automatikusan frissülő, karbantartásmentes WordPress-élménnyé alakítható.','Room 34 Creative Services, LLC'=>'Room 34 Creative Services, LLC']];
